            <div className="profile-header">
                <img src={wizardImage} alt="Profile" className="profile-picture" />
            </div>
            <div className="profile-details">

            <h2 className="profile-name"><span id="player-name">JohnDoe123</span></h2>
            <p><strong>Location:</strong> <span id="location">New York, USA</span></p>
            <p><strong>Bio:</strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer nec odio. Praesent libero. Sed cursus ante dapibus diam.</p>
            </div>
        </div>
    );
};

